set batch_size=10;
set require_sequence_in_insert=false;

DROP TABLE IF EXISTS sql_screenshots;

CREATE TABLE `sql_screenshots` (
                                   `sql` varchar(1024) NOT NULL,
                                   `sql_created_month` int NOT NULL,
                                   `sql_created_time` datetime NOT NULL,
                                   `id` varchar(1024) NOT NULL,
                                   `account_id` bigint NULL,
                                   `product` varchar(1024) NULL,
                                   `properties` variant NULL,
                                   `date_time` datetime NULL,
                                   `time_millis` bigint NULL,
                                   `process_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP
) ENGINE=OLAP
UNIQUE KEY(`sql`, `sql_created_month`, `sql_created_time`, `id`)
        AUTO PARTITION BY LIST (`sql`, `sql_created_month`)
        (PARTITION pe5fscreenshots13162 VALUES IN (("sql_screenshots", "16")),
        PARTITION pe5fscreenshots1325024 VALUES IN (("sql_screenshots", "2502")),
        PARTITION pe5fscreenshots1325034 VALUES IN (("sql_screenshots", "2503")),
        PARTITION pe5fscreenshots1325044 VALUES IN (("sql_screenshots", "2504")))
        DISTRIBUTED BY HASH(`id`) BUCKETS 64
        PROPERTIES (
        "replication_allocation" = "tag.location.default: 1",
        "enable_unique_key_merge_on_write" = "true",
        "function_column.sequence_type" = "datetime",
        "store_row_column" = "true",
        "row_store_page_size" = "16384",
        "disable_auto_compaction" = "false"
        );



WITH a as (SELECT   account_id,  properties['cover_url'] cover_url,  ROW_NUMBER() OVER (PARTITION BY account_id ORDER BY sql_created_time DESC) AS rn  FROM sql_screenshots  WHERE   `sql` = 'sql_screenshots'   AND   account_id in (110892617,105083641,110675452,107039703,54675542,109744448,105503656,110890469,109657261,108466147,108870508,32970671,81479540,101553185,110215081,110873051,82365582,110876251,28230174,57649476,109980113,104844318,109407413,87571440,64280379,110371823,110766160,94369556,83341608,110699258) ) SELECT account_id, GROUP_CONCAT(CAST(cover_url AS CHAR)) cover_url FROM a WHERE rn <= 10 GROUP BY a.account_id order by a.account_id;
